// to compile
// g++ -O3 -DNDEBUG -Wall -Wextra -std=c++23 -I../seqan3/include  -isystem ../seqan3/submodules/sdsl-lite/include  -isystem ../seqan3/submodules/cereal/include  -DSEQAN3_HAS_ZLIB=1 -DSEQAN3_HAS_BZIP2=1  -lz -lbz2 -pthread -o global_affine ../source/global_affine.cpp

int main(int argc, char *argv[])
{
    if (argc != 2) {
        std::cerr << "Usage: " << argv[0] << " num_threads" << std::endl;
        return 1;
    }

    int num_threads = std::atoi(argv[1]); 
    if (num_threads <= 0) {
        std::cerr << "Invalid number of threads: " << argv[1] << std::endl;
        return 1;
    }

    int num_queries = 500;
    
    // Set up the alignment configuration
    auto config = seqan3::align_cfg::method_global{} 
                                | seqan3::align_cfg::scoring_scheme{
                                  seqan3::nucleotide_scoring_scheme{}}  
                                | seqan3::align_cfg::output_score{} 
                                | seqan3::align_cfg::output_alignment{}
                                | seqan3::align_cfg::parallel{num_threads};

    auto subset = queries | std::views::take(num_queries);
    auto all_queries = seqan3::views::pairwise_combine(subset);

    // Align each query against each reference
    for (int i = 0; i < 10; i++) {
        auto total_time = 0;
        auto start = std::chrono::high_resolution_clock::now();

        auto alignment_result = seqan3::align_pairwise(all_queries, config);
        auto first_alignment = alignment_result.begin();
        auto end = std::chrono::high_resolution_clock::now();
        auto duration = std::chrono::duration_cast<std::chrono::microseconds>(end-start);
        total_time += duration.count();

	    // std::cout << "Time taken: " << total_time << " microseconds" << '\n';
        times.push_back(total_time);
    }
    int64_t sum = std::accumulate(times.begin(), times.end(), 0);
    double average = static_cast<double>(sum) / 10;
    std::cout << "Average time: " << average << std::endl;
    std::cout << "Throughput: " << num_queries * num_queries / (average / 1'000'000.0) << " alignments/seconds" << std::endl;
    return 0;
}


